const Delivery = () => {
  
    var today = new Date("1/1/2022");
  var date =
    today.getDate() +
    "/" +
    (today.getMonth() + 1) +
    "/" +
    today.getFullYear()
  
    console.log(date.toLocaleString("de-DE"));

  return <div></div>;
};

export default Delivery;
